/**
 * Created by Lenovo on 2019/8/4.
 */
import React from 'react';
import {HashRouter, BrowserRouter,Route,Redirect,Switch,Link,NavLink} from 'react-router-dom';
import Index from './pages/index/index';
import IndexDetail from './pages/index/indexDetail';
const Router = () => (
    <BrowserRouter>
        <Route  exact  path="/"   component={Index}/>
        <Route  exact  path="/indexDetail"   component={IndexDetail}/>
    </BrowserRouter>
);
export default Router;
